import React from "react";
import { FirstName } from "./App";

const CompC = () => {
  return (
    <>
      <FirstName.consumer>
        {(fname) => {
          return <h1>My name is {fname}.</h1>;
        }}
      </FirstName.consumer>
    </>
  );
};

export default CompC;
